import {React,useState,useEffect} from "react";
import logo from "../../logo.svg";
import Navbars from "../Navbar/navbarSignup";
// import { FaUserAlt, FaAddressCard } from "react-icons/fa";
import { BsArrowRightShort, BsArrowLeftShort } from "react-icons/bs";
import { FiEyeOff, FiEye, FiImage } from "react-icons/fi";
import { AiFillCheckCircle } from "react-icons/ai";
import { MdCameraAlt, MdArrowDropDown } from "react-icons/md";
import { Link,useNavigate } from "react-router-dom";
import { data, data5 } from "../Data/data";

import Login1 from "../../Images/Sign_up.png";

import {
  IconButton,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Input,
  Avatar,
  Modal,
  Typography,
  Box,
  Checkbox,
  Autocomplete,
  TextField,
} from "@mui/material";

const Signup = () => {
  const { innerWidth: width } = window;
  const [file, setFile] = useState("");
  const [file2, setFile2] = useState("");
  const [file3, setFile3] = useState("");
  const [firstname, setFirstname] = useState("");
  const [district, setDistrict] = useState("");
  const [address, setAddress] = useState("");
  const [province, setProvince] = useState("");
  const [country, setCountry] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmpassword, setConfirmpassword] = useState("");
  const [mobilephone, setMobilephone] = useState("");
  const [screen, setScreen] = useState("");
  const [postalcode, setPostalCode] = useState("");
  const [companyname, setCompanyname] = useState("");
  const [juristicPersonNumber, setJuristicPersonNumber] = useState("");
  const [website, setWebsite] = useState("");
  const [bankname, setBankname] = useState("");
  const [branchname, setBranchname] = useState("");
  const [accountname, setAccountname] = useState("");
  const [accountnumber, setAccountnumber] = useState("");
  const [languages, setLanguages] = useState("");

  const [type, setType] = useState("password");
  const [type2, setType2] = useState("password");
  const [values, setValues] = useState(false);
  const [values2, setValues2] = useState(false);
  const [open, setOpen] = useState(false);
  const [open2, setOpen2] = useState(false);

  const [open3, setOpen3] = useState(false);
  const [open4, setOpen4] = useState(false);
  const [checked, setChecked] = useState(false);
  const [checked2, setChecked2] = useState(false);
  const [images,setImages] =useState([]);
  const [imageURL,setImageURL] =useState([]);

  useEffect(()=>{
    if(images.length<1)return;
    const newImageUrls = [];
    images.forEach(image)
  })

  const navigate = useNavigate();

  const handleOpen = () => setOpen(true);

  const handleClose = () => {
    setOpen(false);
    setChecked(false);
    setOpen2(true);
  };

  const handleClose2 = () => setOpen2(false);
  const handleClose3 = () => setOpen3(false);

  const handleClose4 = () => {
    setOpen3(false);
    setChecked2(false);
    setOpen4(true);
  };

  const handleClose5 = () => {
    setOpen4(false);
    navigate('/Login')
  }


  const handleClickShowPassword = (i) => {
    if (i === 1) {
      if (type === "password") {
        setValues(!values);
        setType("text");
      } else if (type === "text") {
        setValues(!values);
        setType("password");
      }
    } else if (i === 2) {
      if (type2 === "password") {
        setValues2(!values2);
        setType2("text");
      } else if (type === "text") {
        setValues2(!values2);
        setType2("password");
      }
    }
  };

  const handleChange = (event) => {
    // console.log(event.target.value);
    setScreen(event.target.value);
  };

  const handleChange2 = (event) => {
    setChecked(event.target.checked);
    setChecked2(event.target.checked);
  };


  return (
    <>
